import React from 'react'

type Props = {
  setGainYards:React.Dispatch<React.SetStateAction<string>>
}

const BallTeam:React.FC<Props> = ({setGainYards}) => {

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    // console.log(e.target.value);
    setGainYards(e.target.value);
  }
  return (
    <>
    <div className="mx-2 "><h5>Yards Gained</h5></div>
        <input type="text" onChange={(e)=>handleChange(e)} className="col-10 col-sm-3"/>
    </>
  )
}

export default BallTeam
